import React, { useState } from 'react'
import CalendarView from './CalendarView'
import './Home.css'

const Home = () => {

  const [formData, setFormData] = useState({
    professor: '',
    department: '',
    school: '',
    room: '',
    day: '',
    startTime: '',
    endTime: ''
  })

  const [bookings, setBookings] = useState([])
  const [selectedBooking, setSelectedBooking] = useState(null)

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value })
  }

  const isOverlapping = (newBooking) => {
    return bookings.some(b =>
      b.day === newBooking.day &&
      newBooking.startTime < b.endTime &&
      newBooking.endTime > b.startTime
    )
  }

  const handleSubmit = (e) => {
    e.preventDefault()

    if (isOverlapping(formData)) {
      alert('This time slot is already booked!')
      return
    }

    setBookings([...bookings, formData])

    setFormData({
      professor: '',
      department: '',
      school: '',
      room: '',
      day: '',
      startTime: '',
      endTime: ''
    })
  }

  return (
    <>
      <div className="dashboard">
        <div className="card">
          <h3>Book Conference Room</h3>

          <form onSubmit={handleSubmit} className="booking-form">
            <input name="professor" placeholder="Professor" value={formData.professor} onChange={handleChange} />
            <input name="department" placeholder="Department" value={formData.department} onChange={handleChange} />
            <input name="school" placeholder="School" value={formData.school} onChange={handleChange} />
            <input name="room" placeholder="Room" value={formData.room} onChange={handleChange} />

            <select name="day" value={formData.day} onChange={handleChange}>
              <option value="">Select Day</option>
              <option>Monday</option>
              <option>Tuesday</option>
              <option>Wednesday</option>
              <option>Thursday</option>
              <option>Friday</option>
              <option>Saturday</option>
              <option>Sunday</option>
            </select>

            <select name="startTime" value={formData.startTime} onChange={handleChange}>
              <option value="">Start Time</option>
              <option>08:00</option>
              <option>09:00</option>
              <option>09:50</option>
              <option>10:40</option>
              <option>11:30</option>
              <option>12:20</option>
              <option>14:00</option>
              <option>15:00</option>
              <option>16:00</option>
            </select>

            <select name="endTime" value={formData.endTime} onChange={handleChange}>
              <option value="">End Time</option>
              <option>09:00</option>
              <option>09:50</option>
              <option>10:40</option>
              <option>11:30</option>
              <option>12:20</option>
              <option>14:00</option>
              <option>15:00</option>
              <option>16:00</option>
              <option>17:00</option>
            </select>

            <button type="submit">Confirm Booking</button>
          </form>
        </div>

        <div className="card">
          <h3>Weekly Calendar</h3>
          <CalendarView
            bookings={bookings}
            onBookingClick={setSelectedBooking}
          />
        </div>
      </div>

      {/* POPUP DIALOG */}
      {selectedBooking && (
        <div className="modal-overlay">
          <div className="modal">
            <h3>Meeting Details</h3>
            <p><b>Professor:</b> {selectedBooking.professor}</p>
            <p><b>Department:</b> {selectedBooking.department}</p>
            <p><b>School:</b> {selectedBooking.school}</p>
            <p><b>Room:</b> {selectedBooking.room}</p>
            <p><b>Day:</b> {selectedBooking.day}</p>
            <p><b>Time:</b> {selectedBooking.startTime} – {selectedBooking.endTime}</p>
            <button onClick={() => setSelectedBooking(null)}>Close</button>
          </div>
        </div>
      )}
    </>
  )
}

export default Home

